import React, { useEffect, useState } from "react";
import Form from "react-bootstrap/Form";
import AvatarDisplay from "../components/AvatarDisplay";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
const Update = () => {
  const [inputFields, setInputFields] = useState([{ comment: "", files: "" }]);
  const handleFormChange = (index, event) => {
    console.log(inputFields);
    let data = [...inputFields];
    data[index][event.target.name] = event.target.value;
    setInputFields(data);
  };
  const addFields = () => {
    let newfield = { comment: "", files: "" };
    setInputFields([...inputFields, newfield]);
  };
  const submit = (e) => {
    e.preventDefault();
    console.log(inputFields);
  };
  const removeFields = (index) => {
    let data = [...inputFields];
    data.splice(index, 1);
    setInputFields(data);
  };
  return (
    <>
      <div className="vh-100-child-update">
        <div className="container py-5 h-100">
          <div className="row d-flex justify-content-center align-items-center h-100">
            <Row className="mb-3">
              <Form.Group as={Col} controlId="formGridAddress1">
                <Form.Label>Name</Form.Label>
                <Form.Control placeholder="1234 Main St" />
              </Form.Group>
              <Form.Group as={Col} controlId="formGridAddress1">
                <Form.Label>Thumbnail</Form.Label>
                <Form.Control placeholder="1234 Main St" />
              </Form.Group>
              
            </Row>
            <Row className="mb-3">
            <Form.Group as={Col} controlId="formGridAddress1">
                <Form.Label>TicketName</Form.Label>
                <Form.Control placeholder="1234 Main St" />
              </Form.Group>
              <Form.Group as={Col} controlId="formGridAddress1">
                <Form.Label>Sprint Name</Form.Label>
                <Form.Control placeholder="1234 Main St" />
              </Form.Group>
              </Row>
          </div>
        </div>
      </div>
      <div className="vh-100-update">
        <div className="container py-5 h-100">
          <div className="row d-flex justify-content-center align-items-center h-100">
            <Form onSubmit={submit}>
              {inputFields.map((input, index) => {
                return (
                  <div key={index}>
                    <Form.Group
                      className="mb-3"
                      controlId="exampleForm.ControlTextarea1"
                    >
                      <Form.Label>Comment/Description</Form.Label>
                      <Form.Control
                        as="textarea"
                        name="comment"
                        value={input.comment}
                        onChange={(event) => handleFormChange(index, event)}
                        rows={3}
                      />
                    </Form.Group>
                    <Form.Group controlId="formFileMultiple" className="mb-3">
                      <Form.Label>Multiple files input example</Form.Label>
                      <Form.Control
                        type="file"
                        name="files"
                        value={input.files}
                        onChange={(event) => handleFormChange(index, event)}
                        multiple
                      />
                    </Form.Group>
                    <button onClick={() => removeFields(index)}>Remove</button>
                    <span>View Files</span>
                    <AvatarDisplay></AvatarDisplay>
                  </div>
                );
              })}
            </Form>

            {/* <span>Child Issues</span> */}
          </div>
        </div>
      </div>
      <button onClick={submit}>Submit</button>
      <button onClick={addFields}>Add More..</button>
    </>
  );
};
export default Update;
